import React from 'react';
import logo from './logo.svg';
import './App.css';
import Part1 from "./Component/Part1Comp";
import Part2 from "./Component/Part2Comp";

function App() {
  return (
    <div className="App">
       <h1> I am in control of this application and my name is Nilou </h1>
       <Part1/>

      <header className="App-header">

        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
